import { StyleSheet, Text, View } from 'react-native'
import React from 'react'

const LogInScreen = () => {
  return (
    <View>
      <Text>LogInScreen</Text>
    </View>
  )
}

export default LogInScreen

const styles = StyleSheet.create({})
